int x = 25;
//判断二分出的答案是否符合条件
int check(int num) {
	return sz[num] >= x;//比较超过返回1, 否则返回0
}
//二分
int int_bsearch(int l, int r)//左右边界
{
	int ans, mid;//ans记录答案
	while (l <= r) {
		mid = l + r >> 1;//二进制数右移一位, 相当于/2, 但更快
		if (check(mid))ans = mid, r = mid - 1;
		else l = mid + 1;
	}
	return ans;
}
int main() {
	//使用例 找有序数组中第一次出现x的数组下标(什么?你想找最后一次出现的数组下标? 看下面
	printf("%d", int_bsearch(0, 9999));//显然x在整个数组区间
	return 0;
}

